function crops_js() {

    /* Object & array with components "name-to-id" mapping */
    var n2id_buf = {
        'mobilebutton_11': 'crops_mobilebutton_11',
        'spacer_21': 'crops_spacer_21',
        'mobileworkarea_18': 'crops_mobileworkarea_18',
        'spacer_88': 'crops_spacer_88',
        'mobilelabel_67': 'crops_mobilelabel_67',
        'html_86': 'crops_html_86',
        'getinfo1': 'crops_getinfo1',
        'mobilebutton_87': 'crops_mobilebutton_87',
        'mobileimage_3': 'crops_mobileimage_3',
        'mobilelabel_20': 'crops_mobilelabel_20',
        'Crops': 'crops_Crops',
        'Insurance': 'crops_Insurance',
        'Agrotips': 'crops_Agrotips'
    };

    if ("n2id" in window && window.n2id !== undefined) {
        $.extend(n2id, n2id_buf);
    } else {
        window.n2id = n2id_buf;
    }

    /*
     * Nonvisual components
     */

    Apperyio.mappings = Apperyio.mappings || {};

    Apperyio.datasources = Apperyio.datasources || {};

    Apperyio.CurrentScreen = 'crops';
    _.chain(Apperyio.mappings).filter(function(m) {
        return m.homeScreen === Apperyio.CurrentScreen;
    }).each(Apperyio.UIHandler.hideTemplateComponents);

    /*
     * Events and handlers
     */

    // On Load
    var crops_onLoad = function() {
            crops_elementsExtraJS();

            crops_deviceEvents();
            crops_windowEvents();
            crops_elementsEvents();
        };

    // screen window events


    function crops_windowEvents() {

        $('#crops').bind('pageshow orientationchange', function() {
            var _page = this;
            adjustContentHeightWithPadding(_page);
        });

    };

    // device events


    function crops_deviceEvents() {
        document.addEventListener("deviceready", function() {

        });
    };

    // screen elements extra js


    function crops_elementsExtraJS() {
        // screen (crops) extra code

    };

    // screen elements handler


    function crops_elementsEvents() {
        $(document).on("click", "a :input,a a,a fieldset label", function(event) {
            event.stopPropagation();
        });

        $(document).off("click", '#crops_mobileheader [name="mobilebutton_11"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    $('[id="crops_panel_2"]').panel("open");

                }
            },
        }, '#crops_mobileheader [name="mobilebutton_11"]');

        $(document).off("click", '#crops_mobilecontainer [name="getinfo1"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('sel_dist', {
                        reverse: false
                    });

                }
            },
        }, '#crops_mobilecontainer [name="getinfo1"]');
        $(document).off("click", '#crops_mobilecontainer [name="mobilebutton_87"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('deal_login', {
                        reverse: false
                    });

                }
            },
        }, '#crops_mobilecontainer [name="mobilebutton_87"]');

        $(document).off("click", '#crops_panel_2 [name="Crops"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('crops', {
                        transition: 'fade',
                        reverse: false
                    });

                }
            },
        }, '#crops_panel_2 [name="Crops"]');
        $(document).off("click", '#crops_panel_2 [name="Insurance"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Insurance', {
                        transition: 'pop',
                        reverse: false
                    });

                }
            },
        }, '#crops_panel_2 [name="Insurance"]');
        $(document).off("click", '#crops_panel_2 [name="Agrotips"]').on({
            click: function(event) {
                if (!$(this).attr('disabled')) {
                    Apperyio.navigateTo('Agrotips', {
                        transition: 'fade',
                        reverse: false
                    });

                }
            },
        }, '#crops_panel_2 [name="Agrotips"]');

    };

    $(document).off("pagebeforeshow", "#crops").on("pagebeforeshow", "#crops", function(event, ui) {
        Apperyio.CurrentScreen = "crops";
        _.chain(Apperyio.mappings).filter(function(m) {
            return m.homeScreen === Apperyio.CurrentScreen;
        }).each(Apperyio.UIHandler.hideTemplateComponents);
    });

    crops_onLoad();
};

$(document).off("pagecreate", "#crops").on("pagecreate", "#crops", function(event, ui) {
    Apperyio.processSelectMenu($(this));
    crops_js();
});